import React from 'react'
import './../../App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Carousel from 'react-bootstrap/Carousel';
import InputGroup from 'react-bootstrap/InputGroup';
import Card from 'react-bootstrap/Card';

const Main = () => {

    return(
        <Container fluid>
            <div className='firstRowHeader row'>
                <Col><span>شماره تماس : 0842248142</span></Col>
                <Col><span><a href="#">ساعت کار فروشگاه</a></span></Col>
                <Col className='loginBtn'><a href='#'>ورود</a> | <a href='#'>ثبت نام</a></Col>
            </div>
            <div className='secondRowHeader row'>
                <Col className='logo'><img src={require("./../../media/img/logo.png")} width={100} /></Col>
                <div className='col-md-5' >
                    <Form>
                        <Form.Control type='text' placeholder='جستجوی کالا' />
                    </Form>
                </div>
                <Col style={{backgroundColor:'red',textAlign:'center'}} className='logo' > <a href='#'>سبد خرید</a></Col>
            </div>

        </Container>
    )

}

export default Main
